import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';


class App extends Component{

  constructor(props){
    super(props);
    this.state = {
      data : []
    }
  }

  componentDidMount(){
      fetch('http://localhost:8080/data')
        .then(res => res.json())
        .then(json => {
            this.setState({
              data : json
            })
        });
  }

  render(){

    var {data} = this.state;
    return(
      <div className ="App">
        <table class="table table-striped table-dark">
          <thead>
            <tr>
              <th scope="col">Id</th>
              <th scope="col">country</th>
              <th scope="col">State</th>
              <th scope="col">Confirmed</th>
              <th scope="col">Death</th>
              <th scope="col">Recovered</th>
            </tr>
          </thead>
          <tbody>
          {data.map(d=>(
            <tr>

              <td>{d.id}</td>
              <td>{d.country}</td>
              <td>{d.state}</td>
              <td>{d.confirmed}</td>
              <td>{d.death}</td>
              <td>{d.recovered}</td>
            </tr>
          ))};
          </tbody>
        </table>
       </div>
    )
  }
}
export default App;
